import ChartBar from './ChartBar'
import './Chart.css'

const Chart = ({ dataPoints }) => { 
    const maxValue = Math.max(1,2,3)
    return (
        <div className="chart">
            {dataPoints.map((point) => (
                <ChartBar
                    key={ point.label }
                    label={point.label}
                    value={point.value}
                    maxValue={null}
                />))
            }
        </div>
    )
}
export default Chart
